import React from 'react';
import './Button.css';
import CorpExplain from './CorpExplain';

class CorpButton extends React.Component {
    constructor (props) {
        super(props);

        };

        render() {
            if (this.props.visible === false && this.props.buttonHide === false) {
            return (
                <div id="buttons">
                    <div id="circle">
                        <img className="corpButtonImage" src={require('./assets/factory-figure.png')}/><br />
                        <p id="corpButtonTag" >Multi-Location</p>
                    </div>
                    <CorpExplain visible={this.props.visible} buttonHide={this.props.buttonHide}/>
                </div>
            )} else {
                return null
            }
        }
    }

export default CorpButton;
